import React, { useState, useEffect } from 'react';
import axios from 'axios';
import './ITEquipment.css';

const ITEquipment = () => {
  const [itEquipments, setITEquipments] = useState([]);
  const [newEquipment, setNewEquipment] = useState({
    categorie: '',
    marque: '',
    model: '',
    code_materiel: '',
    serie: '',
    code_localisation: '',
    code_entite: '',
    date_installation: '',
    fin_garantie: '',
    statut: '',
    type_acquisition: '',
    date_achat: '',
    date_livraison: '',
    fournisseur: '',
    numero_facture: '',
    prix_achat: '',
    numero_appel_offre: '',
    numero_livraison: '',
    cout_maintenance: '',
    emploi_principal: '',
    niveau_criticite: '',
    sla: '',
    date_sortie: '',
  });

  useEffect(() => {
    const fetchITEquipments = async () => {
      try {
        const response = await axios.get('/api/it-equipments');
        setITEquipments(response.data);
      } catch (error) {
        console.error('Error fetching IT Equipments:', error);
      }
    };

    fetchITEquipments();
  }, []);

  const handleAddEquipment = async () => {
    try {
      const response = await axios.post('/api/it-equipments', newEquipment);
      setITEquipments([...itEquipments, response.data]);
      setNewEquipment({
        categorie: '',
        marque: '',
        model: '',
        code_materiel: '',
        serie: '',
        code_localisation: '',
        code_entite: '',
        date_installation: '',
        fin_garantie: '',
        statut: '',
        type_acquisition: '',
        date_achat: '',
        date_livraison: '',
        fournisseur: '',
        numero_facture: '',
        prix_achat: '',
        numero_appel_offre: '',
        numero_livraison: '',
        cout_maintenance: '',
        emploi_principal: '',
        niveau_criticite: '',
        sla: '',
        date_sortie: '',
      });
    } catch (error) {
      console.error('Error adding IT Equipment:', error);
    }
  };

  const handleDeleteEquipment = async (id) => {
    try {
      await axios.delete(`/api/it-equipments/${id}`);
      setITEquipments(itEquipments.filter(equipment => equipment.id !== id));
    } catch (error) {
      console.error('Error deleting IT Equipment:', error);
    }
  };

  const handleChange = (e) => {
    setNewEquipment({ ...newEquipment, [e.target.name]: e.target.value });
  };

  return (
    <div className="it-equipment-manager">
      <h1>IT Equipment Manager</h1>
      <div className="add-equipment">
        <input
          type="text"
          name="categorie"
          value={newEquipment.categorie}
          onChange={handleChange}
          placeholder="Categorie"
        />
        <input
          type="text"
          name="marque"
          value={newEquipment.marque}
          onChange={handleChange}
          placeholder="Marque"
        />
        <input
          type="text"
          name="model"
          value={newEquipment.model}
          onChange={handleChange}
          placeholder="Model"
        />
        {/* Add other input fields here as per the newEquipment state */}
        <button onClick={handleAddEquipment}>Add Equipment</button>
      </div>
      <div className="table-container">
        <div className="table-actions">
          <button onClick={() => handleAddEquipment('above')} className="action-button">Add Row Above</button>
          <button onClick={() => handleAddEquipment('below')} className="action-button">Add Row Below</button>
          <button className="action-button delete">Delete Selected</button>
        </div>
        <table className="data-table">
          <thead>
            <tr>
              <th>#</th>
              <th>Categorie</th>
              <th>Marque</th>
              <th>Model</th>
              {/* Add other table headers here */}
              <th>Actions</th>
            </tr>
          </thead>
          <tbody>
            {itEquipments.map((equipment, index) => (
              <tr key={equipment.id}>
                <td>{index + 1}</td>
                <td>{equipment.categorie}</td>
                <td>{equipment.marque}</td>
                <td>{equipment.model}</td>
                {/* Add other table data cells here */}
                <td>
                  <button onClick={() => handleDeleteEquipment(equipment.id)}>Delete</button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ITEquipment;
